import React, { Component } from 'react';
import { Link, BrowserRouter as Router } from 'react-router-dom';
import Welcome from '../welcome/welcome';
import Login from '../login/Login';

class Header extends Component {


    constructor(props) {

        super();
    }
    render() {
        return (
            <div className="Header">
                <header className="navbar navbar-expand-sm navbar-dark bg-primary"  >
                    <a className="navbar-brand" href='/login'>Navbar</a>

                    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                        <li className="nav-item active">
                            <Router path="/login" exact Component={Login}> 
                            <Link className="nav-link" to='/welcome'>Home
                             <span className="sr-only">(current)</span>
                             </Link>
                            </Router>
                        </li>
                        <li className="nav-item">
                            {/* <Link className="nav-link" to='/login'>Welcome</Link> */}
                        </li>
                    </ul>
                    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                        <li className="nav-item active">
                            {/* <Link className="nav-link" to='/login'>Login <span className="sr-only">(current)</span></Link> */}
                        </li>
                        <li className="nav-item">
                            {/* <Link className="nav-link" to='/login'>Logout</Link> */}
                        </li>
                    </ul>
                </header>

                {/* <Router path="/welcome" Component={Welcome}>               </Router> */}
            </div>
        );


    }
}

export default Header;
